import React,{Component, useEffect} from 'react';
import './App.css';
import Intro from '../Intro';
import { render } from '@testing-library/react';

function App() {

  const series = ["viking","money"]

  const state = {
    series:[]
  }

  return (
    <div className="App">
      <header className="App-header">
        <h1 className="App-title">TV series</h1>
      </header>
      <Intro message=" here is our new app"/>
      this length of the series is - {series[0]}
    </div>
  );

}

export default App;
